parameters.content:
UPDATE NOTION

1. Connect same Notion credentials
2. Same database as Part 1
3. Add property mappings:
   - Status -> {{ $json.reason }}
   - Call Summary -> {{ $json.summary }}
   - Call Recording -> {{ $json.recording }}
   - Call Notes -> {{ $json.notes }}

parameters.jsCode:
const callData = $input.item.json.data?.[1] || $input.item.json.data?.[0] || {};
const customer = callData.customer || {};

const endedReason = callData.endedReason || 'unknown';
const wasAnswered = endedReason !== 'customer-did-not-answer';

console.log('Call ended reason:', endedReason);
console.log('Was answered:', wasAnswered);

if (!wasAnswered) {
  console.log('Skipping AI summary - call not answered');
  return [{
    json: {
      summary: 'No answer - call not connected',
      notes: 'Lead did not pick up the phone.',
      recording: callData.recordingUrl || '',
      reason: 'No answer',
      skip_ai: true
    }
  }];
}

return [{
  json: {
    summary_input: `Lead: ${customer.name || 'Unknown'}
Duration: ${callData.duration || 0}s
Outcome: ${endedReason}
Call Summary: ${callData.summary || 'None provided'}
Notes: ${callData.notes || 'None'}`.trim(),
    recording: callData.recordingUrl || '',
    raw_reason: endedReason,
    skip_ai: false
  }
}];

return [{
  json: {
    summary: $json.summary,
    notes: $json.notes,
    recording: $json.recording,
    reason: $json.reason
  }
}];

const aiOutput = $json.output || $json.summary;
const recording = $('Extract Call Fields2').item.json.recording;
const rawReason = $('Extract Call Fields2').item.json.raw_reason;

let notionStatus = 'Follow Up';
if (rawReason.includes('Meeting Scheduled') || rawReason.includes('scheduled')) {
  notionStatus = 'Meeting Scheduled';
} else if (rawReason.includes('Not Interested') || rawReason.includes('not interested')) {
  notionStatus = 'Not Interested';
} else if (rawReason.includes('customer-did-not-answer') || rawReason.includes('no answer')) {
  notionStatus = 'No answer';
}

return [{
  json: {
    summary: aiOutput,
    notes: `Call ended: ${rawReason}`,
    recording: recording,
    reason: notionStatus
  }
}];

const leadName = $('Get New Leads from Notion2').item.json.property_name;
const business = $('Get New Leads from Notion2').item.json.property_business || 'Test Business';

return [{
  json: {
    data: `Welcome to ${business}. We are a leading provider of business solutions. Our services include consulting, software development, and digital transformation. Contact us today to learn more about how we can help your business grow.`
  }
}];

const html = $input.item.json.data || '';

console.log('Original HTML size:', html.length, 'characters');

let cleaned = html
  .replace(/<script\b[^<]*(?:(?!<\/script>)<[^<]*)*<\/script>/gi, '')
  .replace(/<style\b[^<]*(?:(?!<\/style>)<[^<]*)*<\/style>/gi, '')
  .replace(/<!--[\s\S]*?-->/g, '')
  .replace(/<head\b[^<]*(?:(?!<\/head>)<[^<]*)*<\/head>/gi, '');

let text = cleaned.replace(/<[^>]+>/g, ' ');

text = text
  .replace(/\s+/g, ' ')
  .replace(/\n+/g, ' ')
  .trim();

const truncated = text.substring(0, 2000);

const tokensSaved = Math.floor((html.length - truncated.length) / 4);

console.log('Cleaned size:', truncated.length, 'characters');
console.log('Estimated tokens saved:', tokensSaved);

return [{
  json: {
    data: truncated,
    metadata: {
      original_size: html.length,
      cleaned_size: truncated.length,
      tokens_saved: tokensSaved
    }
  }
}];

